Ensures a value is in the entry by inserting if it was vacant.

# Examples

```
#![feature(hash_set_entry)]

use std::collections::HashSet;

let mut set = HashSet::new();

// nonexistent key
set.entry("poneyland").or_insert();
assert!(set.contains("poneyland"));

// existing key
set.entry("poneyland").or_insert();
assert!(set.contains("poneyland"));
assert_eq!(set.len(), 1);
```
